	(117, 'dispensing of pellets', 1, 'dispensing', '0', 'Pictures\\Default\\Operations\\PickByLight.png', 'http://172.21.0.90/I4.0/mes4/EN/mes4.php?content=manual&OpNo=116&program=#Parameter1'),
