	(123, 'drilling', 1, 'drilling', '', 'Pictures\\Default\\Operations\\Drilling.png', ''),
	(193, 'CNC milling of \r\nfront cover', 1, 'BufRobM fc', '', 'Pictures\\Default\\Operations\\Milling.png', '(Default programs: ... \r\n10 - main pocket contour\r\n20 - main pocket contour, joy stck opening, rectangle and 4 round pockets\r\n21 - joy stick opening, rectangle and 4 round pockets\r\n30 - all pockets and opening)'),
	(194, 'CNC milling of \r\nfront cover', 1, 'FeedRobM fc', '', 'Pictures\\Default\\Operations\\Feeding.png', '(Default programs: ... \r\n10 - main pocket contour\r\n20 - main pocket contour, joy stck opening, rectangle and 4 round pockets\r\n21 - joy stick opening, rectangle and 4 round pockets\r\n30 - all pockets and opening)'),
	(195, '3D printing', 1, 'start 3D print', '', 'Pictures\\Default\\Operations\\Feeding.png', 'http://172.21.0.90/I4.0/mes4/EN/mes4.php?content=manual&OpNo=195&Workpiece=#Parameter1&Action=#Parameter2&custom'),
	(200, 'feed front cover from magazin', 1, 'feed front cover', '', 'Pictures\\Default\\Operations\\Feeding.png', ''),
	(201, 'feed back cover from magazine', 1, 'feed back cover', '', 'Pictures\\Default\\Operations\\Feeding.png', ''),
	(202, 'store part', 1, 'store', '/* update buffer table */\nUPDATE tblbufferpos \nSET tblbufferpos.PNo = #Parameter3, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter2 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID;\n\n/* update buffer table when error */\nError(UPDATE tblbufferpos SET tblbufferpos.PNo = 26, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0 \nWHERE tblbufferpos.BufPos = #Parameter2 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID);', 'Pictures\\Default\\Operations\\Release.png', ''),
	(203, 'release part', 1, 'release', '/* update buffer table */\nUPDATE tblbufferpos SET tblbufferpos.PNo = 0, tblbufferpos.ONo = 0, tblbufferpos.OPos = 0, tblbufferpos.TimeStamp = Null, tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter1 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID;\n\n/*update buffer table when error */\nError(UPDATE tblbufferpos SET tblbufferpos.PNo = 26, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter1 AND tblbufferpos.BufNo=1 AND tblbufferpos.ResourceId = #ResourceID);', 'Pictures\\Default\\Operations\\Release.png', ''),
	(205, 'deliver part', 1, 'deliver', '', 'Pictures\\Default\\Operations\\Output.png', ''),
	(210, 'store a part from stopper 1', 1, 'store P1', '/* update buffer table */\nUPDATE tblbufferpos \nSET tblbufferpos.PNo = #Parameter3, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter2 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID;\n\n/* update buffer table when error */\nError(UPDATE tblbufferpos SET tblbufferpos.PNo = 26, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0 \nWHERE tblbufferpos.BufPos = #Parameter2 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID);', 'Pictures\\Default\\Operations\\store.png', ''),
	(211, 'store a part from stopper 2', 1, 'store P2', '/* update buffer table */\nUPDATE tblbufferpos \nSET tblbufferpos.PNo = #Parameter3, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter2 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID;\n\n/* update buffer table when error */\nError(UPDATE tblbufferpos SET tblbufferpos.PNo = 26, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0 \nWHERE tblbufferpos.BufPos = #Parameter2 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID);', 'Pictures\\Default\\Operations\\store.png', ''),
	(212, 'release a part on stopper 1', 1, 'release P1', '/* update buffer table */\nUPDATE tblbufferpos SET tblbufferpos.PNo = 0, tblbufferpos.ONo = 0, tblbufferpos.OPos = 0, tblbufferpos.TimeStamp = Null, tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter1 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID;\n\n/*update buffer table when error */\nError(UPDATE tblbufferpos SET tblbufferpos.PNo = 26, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter1 AND tblbufferpos.BufNo=1 AND tblbufferpos.ResourceId = #ResourceID);', 'Pictures\\Default\\Operations\\release.png', ''),
	(213, 'release a defined part on stopper 2', 1, 'release P2', '/* update buffer table */\nUPDATE tblbufferpos SET tblbufferpos.PNo = 0, tblbufferpos.ONo = 0, tblbufferpos.OPos = 0, tblbufferpos.TimeStamp = Null, tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter1 AND tblbufferpos.BufNo = 1 AND tblbufferpos.ResourceId = #ResourceID;\n\n/*update buffer table when error */\nError(UPDATE tblbufferpos SET tblbufferpos.PNo = 26, tblbufferpos.TimeStamp = Now(), tblbufferpos.Booked = 0\nWHERE tblbufferpos.BufPos = #Parameter1 AND tblbufferpos.BufNo=1 AND tblbufferpos.ResourceId = #ResourceID);', 'Pictures\\Default\\Operations\\release.png', ''),
	(215, 'store box to target', 1, 'store box', '/* Update PNo in position in box and remove ONo OPos */\nUPDATE tblboxpos \nINNER JOIN tblbufferpos ON tblbufferpos.PNo = tblboxpos.BoxPNo AND tblbufferpos.BoxID = tblboxpos.BoxId \nSET tblboxpos.ONo = IF(#Parameter3, 0, tblboxpos.ONo), tblboxpos.OPos = IF(#Parameter3, 0, tblboxpos.OPos) \nWHERE tblboxpos.ONo = #ONo AND \n	tblboxpos.OPos = #OPos AND \n	tblbufferpos.ResourceId = #ResourceID;', 'Pictures\\Default\\empty.png', ''),
	(217, 'feed from box with customizable parameters', 1, 'feed from box (custom.)', 'UPDATE tblboxpos\nSET tblboxpos.ONo=0, tblboxpos.OPos=0, tblboxpos.PNo=0\nWHERE tblboxpos.ONo=#ONo AND tblboxpos.OPos=#OPos;', 'Pictures\\Default\\empty.png', ''),
	(218, 'feed into box with customizable parameters', 1, 'feed into box (custom.)', '', 'Pictures\\Default\\empty.png', ''),
	(300, 'assemble \r\nPCB and fuses', 1, 'robot assembly', 'UPDATE tblBufferPos INNER JOIN tblBoxPos ON (tblBufferPos.BoxID = tblBoxPos.BoxId) AND (tblBufferPos.PNo = tblBoxPos.BoxPNo)\nSET tblBoxPos.ONo = 0, tblBoxPos.OPos = 0, tblBoxPos.PNo = 0\nWHERE (((tblBufferPos.ResourceId)=#ResourceID) AND ((tblBufferPos.BufNo)=1) AND ((tblBoxPos.BoxPos)=( SELECT tblStepParameter.Parameter \nFROM tblStepParameter\nWHERE (((tblStepParameter.StepNo)=#StepNo) AND ((tblStepParameter.ONo)=#ONo) AND ((tblStepParameter.OPos)=#OPos) AND ((tblStepParameter.ParameterNo)=4)))) AND ((tblBufferPos.BufPos)=2));', 'Pictures\\Default\\Operations\\AssPCB2Fuses.png', ''),
	(301, 'assemble a PCB with no fuse', 1, 'assemble PCB, no fuse', 'UPDATE tblBufferPos INNER JOIN tblBoxPos ON (tblBufferPos.BoxID = tblBoxPos.BoxId) AND (tblBufferPos.PNo = tblBoxPos.BoxPNo)\nSET tblBoxPos.ONo = 0, tblBoxPos.OPos = 0, tblBoxPos.PNo = 0\nWHERE (((tblBufferPos.ResourceId)=#ResourceID) AND ((tblBufferPos.BufNo)=1) AND ((tblBoxPos.BoxPos)=( SELECT tblStepParameter.Parameter \nFROM tblStepParameter\nWHERE (((tblStepParameter.StepNo)=#StepNo) AND ((tblStepParameter.ONo)=#ONo) AND ((tblStepParameter.OPos)=#OPos) AND ((tblStepParameter.ParameterNo)=4)))) AND ((tblBufferPos.BufPos)=2));', 'Pictures\\Default\\Operations\\AssPCB.png', NULL),
	(302, 'assemble a PCB with fuse in the front', 1, 'assemble PCB, front fuse', 'UPDATE tblBufferPos INNER JOIN tblBoxPos ON (tblBufferPos.BoxID = tblBoxPos.BoxId) AND (tblBufferPos.PNo = tblBoxPos.BoxPNo)\nSET tblBoxPos.ONo = 0, tblBoxPos.OPos = 0, tblBoxPos.PNo = 0\nWHERE (((tblBufferPos.ResourceId)=#ResourceID) AND ((tblBufferPos.BufNo)=1) AND ((tblBoxPos.BoxPos)=( SELECT tblStepParameter.Parameter \nFROM tblStepParameter\nWHERE (((tblStepParameter.StepNo)=#StepNo) AND ((tblStepParameter.ONo)=#ONo) AND ((tblStepParameter.OPos)=#OPos) AND ((tblStepParameter.ParameterNo)=4)))) AND ((tblBufferPos.BufPos)=2));', 'Pictures\\Default\\Operations\\AssPCB1FuseR.png', NULL),
	(303, 'assemble PCB with a fuse in the back', 1, 'assemble PCB, rear fuse', 'UPDATE tblBufferPos INNER JOIN tblBoxPos ON (tblBufferPos.BoxID = tblBoxPos.BoxId) AND (tblBufferPos.PNo = tblBoxPos.BoxPNo)\nSET tblBoxPos.ONo = 0, tblBoxPos.OPos = 0, tblBoxPos.PNo = 0\nWHERE (((tblBufferPos.ResourceId)=#ResourceID) AND ((tblBufferPos.BufNo)=1) AND ((tblBoxPos.BoxPos)=( SELECT tblStepParameter.Parameter \nFROM tblStepParameter\nWHERE (((tblStepParameter.StepNo)=#StepNo) AND ((tblStepParameter.ONo)=#ONo) AND ((tblStepParameter.OPos)=#OPos) AND ((tblStepParameter.ParameterNo)=4)))) AND ((tblBufferPos.BufPos)=2));', 'Pictures\\Default\\Operations\\AssPCB1Fuse.png', NULL),
	(304, 'assemble a PCB with both fuses', 1, 'assemble PCB, both fuses', 'UPDATE tblBufferPos INNER JOIN tblBoxPos ON (tblBufferPos.BoxID = tblBoxPos.BoxId) AND (tblBufferPos.PNo = tblBoxPos.BoxPNo)\nSET tblBoxPos.ONo = 0, tblBoxPos.OPos = 0, tblBoxPos.PNo = 0\nWHERE (((tblBufferPos.ResourceId)=#ResourceID) AND ((tblBufferPos.BufNo)=1) AND ((tblBoxPos.BoxPos)=( SELECT tblStepParameter.Parameter \nFROM tblStepParameter\nWHERE (((tblStepParameter.StepNo)=#StepNo) AND ((tblStepParameter.ONo)=#ONo) AND ((tblStepParameter.OPos)=#OPos) AND ((tblStepParameter.ParameterNo)=4)))) AND ((tblBufferPos.BufPos)=2));', 'Pictures\\Default\\Operations\\AssPCB2Fuses.png', NULL),
	(310, 'place part from carrier to box', 1, 'PALROB (to box)', '/* Update PNo in position in box and remove ONo OPos */\nUPDATE tblboxpos \nINNER JOIN tblbufferpos ON tblbufferpos.PNo = tblboxpos.BoxPNo AND tblbufferpos.BoxID = tblboxpos.BoxId \nSET tblboxpos.ONo = IF(#Parameter11, 0, tblboxpos.ONo), tblboxpos.OPos = IF(#Parameter11, 0, tblboxpos.OPos), tblBoxPos.PNo = #Parameter9\nWHERE tblbufferpos.ResourceId = #ResourceID AND \n	tblBufferPos.BufNo = #Parameter2 AND \n	tblBoxPos.BoxPos= #Parameter3', 'Pictures\\Default\\Operations\\AssPCB2Fuses.png', 'http://172.21.0.90/I4.0/mes4/EN/mes4.php?content=manual&OpNo=310&program=2000&text=The robot is placing the part into box'),
	(311, 'place part from box to carrier', 1, 'PALROB (from box)', '/* clear position in box */\nUPDATE tblboxpos \nINNER JOIN tblbufferpos ON tblbufferpos.PNo = tblboxpos.BoxPNo AND tblbufferpos.BoxID = tblboxpos.BoxId \nSET tblboxpos.ONo = IF(#Parameter11, 0, tblboxpos.ONo), tblboxpos.OPos = IF(#Parameter11, 0, tblboxpos.OPos), tblBoxPos.PNo = 0\nWHERE tblbufferpos.ResourceId = #ResourceID AND \n	tblBufferPos.BufNo = #Parameter2 AND \n	tblBoxPos.BoxPos= #Parameter3', 'Pictures\\Default\\Operations\\AssPCB2Fuses.png', 'http://172.21.0.90/I4.0/mes4/EN/mes4.php?content=manual&OpNo=311&program=#Parameter9&text=The robot is looking for the following part'),
	(312, 'place part to hand', 1, 'cobot (to hand)', '', 'Pictures\\Default\\Operations\\AssPCB2Fuses.png', 'http://172.21.0.90/I4.0/mes4/EN/mes4.php?content=manual&OpNo=510&Workpiece=#Parameter7&Action=#Parameter8&text='),
	(400, 'check part with camera', 1, 'camera check', '', 'Pictures\\Default\\Operations\\Camera.png', ''),
	(401, 'camera check false if any fuse is detected', 1, 'check no fuse', '', 'Pictures\\Default\\Operations\\Camera.png', ''),
	(402, 'true if the front fuse is detected', 1, 'check front fuse', '', 'Pictures\\Default\\Operations\\Camera.png', ''),
	(403, 'true if the rear fuse is detected', 1, 'check rear fuse', '', 'Pictures\\Default\\Operations\\Camera.png', ''),
	(404, 'true if the both fuses are detected', 1, 'check both fuses', '', 'Pictures\\Default\\Operations\\Camera.png', ''),
	(405, 'check part upside down', 1, 'check part upside down', '', 'Pictures\\Default\\Operations\\Camera.png', ''),
	(502, 'manual boxing', 1, 'Manual boxing', 'UPDATE tblboxpos \nINNER JOIN tblbufferpos ON tblbufferpos.PNo = tblboxpos.BoxPNo AND tblbufferpos.BoxID = tblboxpos.BoxId \nSET tblboxpos.PNo = #Parameter2 \nWHERE tblboxpos.ONo = #ONo AND \n	tblboxpos.OPos = #OPos AND \n	tblbufferpos.ResourceId = #ResourceID;', 'Pictures\\Default\\empty.png', ''),
	(503, 'manual unboxing', 1, 'Manual unboxing', 'UPDATE tblboxpos \nINNER JOIN tblbufferpos ON tblbufferpos.PNo = tblboxpos.BoxPNo AND tblbufferpos.BoxID = tblboxpos.BoxId \nSET tblboxpos.PNo = 0, tblboxpos.ONo = 0, tblboxpos.OPos = 0\nWHERE tblboxpos.ONo = #ONo AND \n	tblboxpos.OPos = #OPos AND \n	tblbufferpos.ResourceId = #ResourceID;', 'Pictures\\Default\\empty.png', ''),
	(510, 'manual', 1, 'manual work', '', 'Pictures\\Default\\Operations\\ManualAssembly.png', 'http://172.21.0.90/I4.0/mes4/EN/mes4.php?content=manual&OpNo=510&Workpiece=#Parameter1&Action=#Parameter2&PNo=#Parameter3'),
	(600, 'send an empty carrier out to the branch', 1, 'deliver empty carrier', '0', 'Pictures\\Default\\empty.png', NULL),
	(601, 'receive an empty carrier back form another island', 1, 'receive empty carrier', '', 'Pictures\\Default\\Operations\\store.png', NULL),
	(610, 'plan box', 1, 'Plan Box', '0', 'Pictures\\Default\\empty.png', ''),
	(904, 'custom operation with 4 paramters', 1, 'Custom 4', NULL, NULL, NULL),
	(1010, 'start suborder', 5, 'StartSub', NULL, 'Pictures\\Default\\empty.png', NULL),
	(1020, 'wait for suborder', 5, 'WaitForSub', NULL, 'Pictures\\Default\\empty.png', NULL),
	(1030, 'service', 5, 'Service', '', 'Pictures\\Default\\Operations\\ManualAssembly.png', NULL),
	(1040, 'search for a box that have this part and book the order in this box position', 5, 'book order for part in box', NULL, 'Pictures\\Default\\empty.png', NULL),
	(1100, 'Wait for SubOrders', 1, 'Wait for SubOrders', '0', 'Pictures\\Default\\empty.png', 'SELECT IF(#Parameter1=0, 1, 0) as ReturnValue'),
	(1101, 'Select Empty Box', 1, 'Select Empty Box', 'UPDATE \ntblboxpos\nINNER JOIN tblstepparameter ON tblstepparameter.ParameterNo = tblboxpos.BoxPos\nINNER JOIN tblstep ON tblstepparameter.ONo = tblstep.ONo AND tblstepparameter.OPos = tblstep.OPos AND tblstepparameter.StepNo = tblstep.StepNo \nSET \ntblboxpos.ONo=IF(tblstepparameter.Parameter <> 0, #ONo, 0), tblboxpos.OPos=IF(tblstepparameter.Parameter <> 0, #OPos, 0)\nWHERE \ntblboxpos.BoxPNo=#Parameter1 AND \ntblboxpos.BoxID=#Parameter3 AND \ntblstepparameter.ParameterNo = tblboxpos.BoxPos AND \n(tblstep.OpNo = 1104 OR \ntblstep.OpNo = 1105) AND \ntblstepparameter.ONo = #ONo AND \ntblstepparameter.OPos = #OPos;\n', 'Pictures\\Default\\empty.png', 'SELECT IF(#Parameter3>0, 1, 0) as ReturnValue'),
	(1102, 'Select Box with content', 1, 'Select Box with content', 'UPDATE \ntblboxpos\nSET \nONo=#ONo, OPos=#OPos\nWHERE \nBoxPNo=#Parameter1 AND \nBoxID=#Parameter3;\n', 'Pictures\\Default\\empty.png', 'SELECT IF(#Parameter3>0, 1, 0) as ReturnValue'),
	(1103, 'Select part in box', 1, 'Select part in box', 'UPDATE tblboxpos\nSET ONo = #ONo, OPos=#OPos\nWHERE\nBoxId = #Parameter2 AND\nBoxPos = #Parameter3 AND\nBoxPNo = 30;\n', 'Pictures\\Default\\empty.png', 'SELECT IF(#Parameter4>0, 1, 0) as ReturnValue'),
	(1104, 'Select parts to remove for Operation 310', 1, 'Select parts to remove', '', 'Pictures\\Default\\empty.png', 'SELECT IF(1=1, 1, 0) as ReturnValue'),
	(1105, 'Select parts to send in for Operation 311', 1, 'Select parts to send in', 'UPDATE tblStepParameter AS tblStepParameterA \nINNER JOIN tblStepParameter AS tblStepParameterB \nINNER JOIN tblStepParameter AS tblStepParameterC \nINNER JOIN tblStep AS tblstepB ON tblstepB.ONo = tblStepParameterB.ONo AND tblstepB.OPos = tblStepParameterB.OPos AND tblstepB.StepNo = tblStepParameterB.StepNo\nINNER JOIN tblStep AS tblstepC ON tblstepC.ONo = tblStepParameterC.ONo AND tblstepC.OPos = tblStepParameterC.OPos AND tblstepC.StepNo = tblStepParameterC.StepNo\nSET tblStepParameterA.Parameter = tblStepParameterB.Parameter \nWHERE \n/* Order copy from */\ntblStepParameterB.ONo = IF(CONVERT(SUBSTRING_INDEX(tblStepParameterC.Parameter, ".", 1), UNSIGNED) <> 0, CONVERT(SUBSTRING_INDEX(tblStepParameterC.Parameter, ".", 1), UNSIGNED), 0) AND \ntblStepParameterB.OPos = IF(CONVERT(SUBSTRING_INDEX(tblStepParameterC.Parameter, ".", -1), UNSIGNED) <> 0, CONVERT(SUBSTRING_INDEX(tblStepParameterC.Parameter, ".", -1), UNSIGNED), 0) AND \ntblStepB.OpNo = 311 AND \ntblStepParameterB.ParameterNo = 9 AND \n/* Order to copy */\ntblStepParameterA.ONo = #ONo AND \ntblStepParameterA.StepNo = 10 AND \ntblStepParameterA.ParameterNo = 2 AND\n/* Common */\ntblStepParameterA.OPos = (100 + tblStepParameterC.ParameterNo) AND\ntblStepParameterC.ONo = #ONo AND \ntblStepParameterC.OPos = #OPos AND \ntblstepC.OpNo = 1105;\n', 'Pictures\\Default\\empty.png', 'SELECT IF(1=1, 1, 0) as ReturnValue'),
	(1106, 'Select parts to remove from Storage', 1, 'Select parts from Storage', 'UPDATE tblstepparameter AS tblStepParameterA \nINNER JOIN tblStepParameter AS tblStepParameterB \nINNER JOIN tblStep ON tblstep.ONo = tblStepParameterB.ONo AND tblstep.OPos = tblStepParameterB.OPos AND tblstep.StepNo = tblStepParameterB.StepNo\nSET tblStepParameterA.Parameter = IF(tblStepParameterB.Parameter <> 0, tblStepParameterB.Parameter, 0)\nWHERE\n/* Order copy from */\ntblStepParameterB.ONo = #ONo AND \ntblStepParameterB.OPos = #OPos AND \ntblstep.OpNo = 1106 AND \n/* Order to copy */ \ntblStepParameterA.ONo = #ONo AND\ntblStepParameterA.StepNo = 10 AND\ntblStepParameterA.ParameterNo = 3 AND\n/*common */\ntblStepParameterA.OPos = (100 + tblStepParameterB.ParameterNo);\n', 'Pictures\\Default\\empty.png', 'SELECT IF(1=1, 1, 0) as ReturnValue'),
	(1107, 'Update Suborders to Orders in box', 1, 'Update Suborders to Orders', 'UPDATE \ntblboxpos\nSET \ntblboxpos.OPos=IF(tblboxpos.PNo <> 0, #OPos, 0), tblboxpos.ONo =IF(tblboxpos.PNo <> 0, #ONo, 0)\nWHERE \ntblboxpos.ONo=#ONo AND \ntblboxpos.OPos=((#OPos * 100) + tblboxpos.BoxPos);', 'Pictures\\Default\\empty.png', 'SELECT IF(1=1, 1, 0) as ReturnValue'),
	(1108, 'select destination of the Box', 1, 'select destination of the Box', 'SetNextStep(140, \n		SELECT \n			tblStep.StepNo as NextStep\n		FROM \n			tblStep\n		WHERE \n			tblStep.ONo= #ONo AND \n			tblStep.OPos= #OPos AND \n			tblStep.ResourceID=IF(#Parameter1 <> 0, 121, 110)\n		ORDER BY StepNo\n		LIMIT 1 \n\n);\n', 'Pictures\\Default\\empty.png', 'SELECT IF(1=1, 1, 0) as ReturnValue'),
	(1109, 'Start: check buffer state and avaialbel orders order', 1, 'Check buffer and order', '0', 'Pictures\\Default\\empty.png', 'SELECT IF((#Parameter1 + #Parameter2)<=2, 1, 0) as ReturnValue'),
	(1110, 'delay two seconds', 5, 'Delay', NULL, 'Pictures\\Default\\empty.png', NULL),
	(1120, 'reset order position before start ', 5, 'ResetPos', NULL, 'Pictures\\Default\\empty.png', NULL),
	(2113, 'turning part with parameter', 1, 'turn with parameter', NULL, 'Pictures\\Default\\Operations\\Turning2.png', NULL),
	(2123, 'drilling pattern and time', 1, 'drilling pattern time', NULL, 'Pictures\\Default\\Operations\\Drilling.png', NULL);
