	(1102, 1, 'Box PNo', 2, 0, 0, 2, '28', 'SELECT tblParts.PNo AS ValueMember, CONCAT(tblParts.PNo , \' | \' , tblParts.Description) AS DisplayMember \n\nFROM tblParts \n\n\nWHERE tblParts.Type=9 \n\n\nORDER BY tblParts.PNo;\n', 3, 0),
	(1102, 2, 'Requested Box ID', 2, 0, 0, 2, '0', '/* Products available in storage */\nSELECT ValueMember, IF(ValueMember = \'0\' OR Quantity = -1, DisplayMember, CAST(CONCAT( DisplayMember, SUM(Quantity)) AS CHAR CHARACTER SET UTF8) ) as DisplayMember\nFROM (\n\n\n(\n\nSELECT\ntblboxpos.BoxId AS ValueMember, CONCAT(\'ID \', tblboxpos.BoxId , \' | \' , \'Num of parts: \') AS DisplayMember, COUNT(tblboxpos.PNo) AS Quantity, tblbufferpos.BufPos AS BufPos\nFROM\ntblbufferpos\nINNER JOIN tblboxpos ON\ntblbufferpos.PNo = tblboxpos.BoxPNo AND\ntblbufferpos.BoxID = tblboxpos.BoxId\nINNER JOIN tblbox ON\ntblbox.BoxPNo = tblboxpos.BoxPNo AND\ntblbox.BoxID = tblboxpos.BoxId\n\nWHERE\ntblbufferpos.ResourceID = 9 AND\n(tblboxpos.BoxPNo = 28 OR tblboxpos.BoxPNo = 27 ) AND\ntblboxpos.ONo = 0 AND\ntblboxpos.OPos = 0 AND\ntblboxpos.PNo <> 0 AND\ntblbox.ONo = 0\nGROUP BY\ntblboxpos.BoxId,\ntblbufferpos.BufNo,\ntblbufferpos.BufPos\nORDER BY\ntblbufferpos.ResourceId,\ntblbufferpos.BufPos\n\n\n)\n\n\nUNION ALL\n\n\n\n(\n\nSELECT\ntblboxpos.BoxId AS ValueMember, CONCAT(\'ID \', tblboxpos.BoxId , \' | \' , \'Order \', tblboxpos.ONo , \' | \' ) AS DisplayMember, COUNT(tblboxpos.PNo) AS Quantity, tblbufferpos.BufPos AS BufPos\nFROM\ntblbufferpos\nINNER JOIN tblboxpos ON\ntblbufferpos.PNo = tblboxpos.BoxPNo AND\ntblbufferpos.BoxID = tblboxpos.BoxId\nINNER JOIN tblbox ON\ntblbox.BoxPNo = tblboxpos.BoxPNo AND\ntblbox.BoxID = tblboxpos.BoxId\nINNER JOIN tblfinorder ON\ntblfinorder.ONo = tblboxpos.ONo\nWHERE\ntblbufferpos.ResourceID = 9 AND\n(tblboxpos.BoxPNo = 28 OR tblboxpos.BoxPNo = 27) AND\n(\ntblboxpos.ONo <> 0 OR\ntblboxpos.OPos <> 0 OR\ntblboxpos.PNo <> 0\n) AND\ntblbox.ONo = 0\nGROUP BY\ntblboxpos.BoxId,\ntblbufferpos.BufNo,\ntblbufferpos.BufPos\nORDER BY\ntblbufferpos.ResourceId,\ntblbufferpos.BufPos\n\n)\n\nUNION ALL\n\n/* nothing */\n(SELECT\n0 AS ValueMember,\nCONCAT(\'nothing\' ) AS DisplayMember,\n-1 AS Quantity, 0 AS BufPos )\n\n\n) AS result\nGROUP BY result.ValueMember\nORDER BY BufPos DESC\n\n\n', 1, 0),
	(1102, 3, 'Found Box ID', 2, 0, 0, 4, '0', 'SELECT IF(#Parameter2<>0, #Parameter2, result.selectedBox) AS Parameter\nFROM (\n\n(\nSELECT\ntblboxpos.BoxId as selectedBox\nFROM\ntblbufferpos\nINNER JOIN tblboxpos ON\ntblbufferpos.PNo = tblboxpos.BoxPNo AND\ntblbufferpos.BoxID = tblboxpos.BoxId\nINNER JOIN tblbox ON\ntblbox.BoxPNo = tblboxpos.BoxPNo AND\ntblbox.BoxID = tblboxpos.BoxId\nWHERE\n(tblbufferpos.ResourceID IN (#Parameter4) OR \'#Parameter4\' = \'\' OR \'#Parameter4\' = \'0, 0, 0\') AND\n(tblboxpos.BoxPNo = #Parameter1 OR #Parameter1 = 0) AND\ntblboxpos.ONo = 0 AND\ntblboxpos.OPos = 0 AND\ntblboxpos.PNo <> 0\nGROUP BY\ntblboxpos.BoxId,\ntblbufferpos.BufNo,\ntblbufferpos.BufPos\nORDER BY\nFIELD(ResourceID, #Parameter4),\ntblbufferpos.BufPos\n)\n\nUNION ALL\n\n(\nSELECT\ntblboxpos.BoxId as selectedBox\nFROM\ntblbufferpos\nINNER JOIN tblboxpos ON\ntblbufferpos.PNo = tblboxpos.BoxPNo AND\ntblbufferpos.BoxID = tblboxpos.BoxId\nINNER JOIN tblbox ON\ntblbox.BoxPNo = tblboxpos.BoxPNo AND\ntblbox.BoxID = tblboxpos.BoxId\nINNER JOIN tblfinorder ON\ntblfinorder.ONo = tblboxpos.ONo\nWHERE\n(tblbufferpos.ResourceID IN (#Parameter4) OR \'#Parameter4\' = \'\' OR \'#Parameter4\' = \'0, 0, 0\') AND\n(tblboxpos.BoxPNo = #Parameter1 OR #Parameter1 = 0) AND\n(\ntblboxpos.ONo <> 0 OR\ntblboxpos.OPos <> 0 OR\ntblboxpos.PNo <> 0\n)\nGROUP BY\ntblboxpos.BoxId,\ntblbufferpos.BufNo,\ntblbufferpos.BufPos\nORDER BY\nFIELD(ResourceID, #Parameter4),\ntblbufferpos.BufPos\n)\n\n) AS result\nGROUP BY Parameter DESC\n\n', 1, 0),
	(1102, 4, 'ResourceIDs with priority', 3, 0, 0, 2, '9, 0, 0', '', 1, 0),
	(1103, 1, 'Select part in box', 2, 0, 0, 2, '0', '/* Products available in storage */\nSELECT ValueMember, IF(ValueMember = \'0\' OR Quantity = -1, DisplayMember, CONCAT(SUM(Quantity) , \' | \', DisplayMember)) as DisplayMember, BufPos\nFROM (\n\n\n(\n	SELECT tblboxpos.PNo AS ValueMember, CONCAT(tblboxpos.PNo , \' | \', tblParts.Description ) AS DisplayMember, COUNT(tblboxpos.PNo) AS Quantity, tblbufferpos.BufPos AS BufPos\n	\n	FROM tblboxpos\n	\n	INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId \n	\n	INNER JOIN tblParts ON tblboxpos.PNo = tblParts.PNo\n	\n	WHERE \n	\n	tblbufferpos.ResourceId = 9 AND \n	tblboxpos.PNo <> 0 AND \n	tblboxpos.ONo = 0 AND tblboxpos.OPos = 0 AND \n	tblbufferpos.BufNo = 1 AND \n	(tblboxpos.BoxPNo = 28 OR tblboxpos.BoxPNo = 27) \n\n	\n	GROUP BY tblboxpos.PNo\n)\n\n\nUNION ALL\n\n/* Orders available in storage */\n(\n	SELECT\n	CONCAT(tblboxpos.ONo , \'.\' , tblboxpos.OPos) AS ValueMember,\n	CONCAT(\'order: \', tblboxpos.ONo , \'.\' , tblboxpos.OPos, \' | \' , tblParts.Description) AS DisplayMember,\n	-1 AS Quantity, tblbufferpos.BufPos AS BufPos\n	\n	FROM tblboxpos\n	\n	INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId \n	\n	INNER JOIN tblParts ON tblboxpos.PNo = tblParts.PNo\n	\n	INNER JOIN tblfinorder ON tblfinorder.ONo = tblboxpos.ONo\n	\n	WHERE \n	\n	tblbufferpos.ResourceId = 9 AND \n	tblboxpos.ONo > 0 AND tblboxpos.OPos > 0 AND \n	tblbufferpos.BufNo = 1 AND \n	(tblboxpos.BoxPNo = 28 OR tblboxpos.BoxPNo = 27) \n\n)\n\nUNION ALL\n\n/* nothing */\n(\n	SELECT\n	0 AS ValueMember,\n	CONCAT(\'nothing\' ) AS DisplayMember,\n	-1 AS Quantity, 0 AS BufPos \n)\n\n\n) AS result\nGROUP BY result.ValueMember\nORDER BY BufPos ASC\n', 1, 0),
	(1103, 2, 'Box Id', 2, 0, 0, 4, '0', 'SELECT IFNULL((\n	if(#Parameter1 = 0, \n	(\n		SELECT tblboxpos.BoxId AS Parameter\n		FROM tblboxpos\n		INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId\n		WHERE tblboxpos.ONo = #ONo AND tblboxpos.OPos = #OPos\n		AND tblBufferPos.ResourceId=#Parameter5 \n		AND tblBufferPos.BufNo = 1 \n		LIMIT 1\n	), \n		if(#Parameter1 LIKE \'%.%\',\n		(\n			SELECT tblboxpos.BoxId AS Parameter\n			FROM tblboxpos\n			INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId \n			WHERE \n			tblboxpos.ONo=CONVERT(SUBSTRING_INDEX(#Parameter1, \'.\', 1), UNSIGNED)\n			AND tblboxpos.OPos=CONVERT(SUBSTRING_INDEX(#Parameter1 , \'.\', -1), UNSIGNED)\n			AND tblBufferPos.ResourceId=#Parameter5 \n			AND tblBufferPos.BufNo = 1 \n			LIMIT 1\n		),\n		(\n			SELECT tblboxpos.BoxId AS Parameter\n			FROM tblboxpos\n			INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId \n			WHERE tblboxpos.PNo=#Parameter1\n			AND tblboxpos.ONo=0\n			AND tblboxpos.OPos=0\n			AND tblBufferPos.ResourceId=#Parameter5 \n			AND tblBufferPos.BufNo = 1 \n			LIMIT 1\n		))\n	)\n),0) as Parameter;', 1, 0),
	(1103, 3, 'Box Position', 2, 0, 0, 4, '0', 'SELECT IFNULL((\nif(#Parameter1 = 0,\n(\nSELECT tblboxpos.BoxPos AS Parameter\nFROM tblboxpos\nINNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId\nWHERE tblboxpos.ONo = #ONo AND tblboxpos.OPos = #OPos\nAND tblBufferPos.ResourceId=#Parameter5 \nAND tblBufferPos.BufNo = 1\nLIMIT 1\n),\nif(#Parameter1 LIKE \'%.%\',\n(\nSELECT tblboxpos.BoxPos AS Parameter\nFROM tblboxpos\nINNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId\nWHERE\ntblboxpos.ONo=CONVERT(SUBSTRING_INDEX(#Parameter1, \'.\', 1), UNSIGNED)\nAND tblboxpos.OPos=CONVERT(SUBSTRING_INDEX(#Parameter1 , \'.\', -1), UNSIGNED)\nAND tblBufferPos.ResourceId=#Parameter5 \nAND tblBufferPos.BufNo = 1\nLIMIT 1\n),\n(\nSELECT tblboxpos.BoxPos AS Parameter\nFROM tblboxpos\nINNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId\nWHERE tblboxpos.PNo=#Parameter1\nAND tblboxpos.ONo=0\nAND tblboxpos.OPos=0\nAND tblBufferPos.ResourceId=#Parameter5 \nAND tblBufferPos.BufNo = 1\nLIMIT 1\n))\n)\n),0) as Parameter;\n', 1, 0),
	(1103, 4, 'Part number', 2, 0, 0, 4, '0', 'SELECT IFNULL((\n	if(#Parameter1 = 0, \n	(\n		SELECT tblboxpos.PNo AS Parameter\n		FROM tblboxpos\n		INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId\n		WHERE tblboxpos.ONo = #ONo AND tblboxpos.OPos = #OPos\n		AND tblBufferPos.ResourceId=#Parameter5 \n		AND tblBufferPos.BufNo = 1 \n		LIMIT 1\n	), \n		if(#Parameter1 LIKE \'%.%\',\n		(\n			SELECT tblboxpos.PNo AS Parameter\n			FROM tblboxpos\n			INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId \n			WHERE \n			tblboxpos.ONo=CONVERT(SUBSTRING_INDEX(#Parameter1, \'.\', 1), UNSIGNED)\n			AND tblboxpos.OPos=CONVERT(SUBSTRING_INDEX(#Parameter1 , \'.\', -1), UNSIGNED)\n			AND tblBufferPos.ResourceId=#Parameter5 \n			AND tblBufferPos.BufNo = 1 \n			LIMIT 1\n		),\n		(\n			SELECT tblboxpos.PNo AS Parameter\n			FROM tblboxpos\n			INNER JOIN tblbufferpos ON tblboxpos.BoxId = tblbufferpos.BoxId \n			WHERE tblboxpos.PNo=#Parameter1\n			AND tblboxpos.ONo=0\n			AND tblboxpos.OPos=0\n			AND tblBufferPos.ResourceId=#Parameter5 \n			AND tblBufferPos.BufNo = 1 \n			LIMIT 1\n		))\n	)\n),0) as Parameter;', 1, 0),
	(1103, 5, 'Select resource', 2, 0, 0, 2, '9', 'SELECT tblResource.ResourceID AS ValueMember, CONCAT(tblResource.ResourceID , \' | \' , tblResource.ResourceName) AS DisplayMember \nFROM tblResource ORDER BY tblResource.ResourceID', 1, 0),
	(1104, 1, 'Box position 1 part', 3, 0, 0, 2, '0', 'SELECT *\nFROM (\n\n/* Orders available with specific Operation number */\n(SELECT\nCONCAT(tblstep.ONo , \'.\' , tblstep.OPos) AS ValueMember,\nCONCAT(\'order: \', tblstep.ONo , \'.\' , tblstep.OPos, \' | \' , \'part: \', tblstepparameter.Parameter) AS DisplayMember\n\nFROM tblstep\n\nINNER JOIN tblParts ON tblstep.WPNo = tblParts.WPNo\nINNER JOIN tblstepparameter ON tblstep.StepNo = tblstepparameter.StepNo AND tblstep.ONo = tblstepparameter.ONo AND tblstep.OPos = tblstepparameter.OPos\n\nWHERE tblstep.OpNo = 310 AND tblstepparameter.ParameterNo = 9\nGROUP BY tblstep.ONo, tblstep.OPos\n)\n\nUNION ALL\n\n/* nothing */\n(SELECT\n0 AS ValueMember,\nCONCAT(\'nothing\' ) AS DisplayMember )\n\n\n) AS result\n\n\n', 1, 0),
