INSERT INTO `tblstepparameterdef` (`WPNo`, `StepNo`, `ParameterNo`, `Parameter`, `ParameterType`, `QueryChooseParameter`) VALUES
	(210, 10, 1, '0', 4, '/* find buffer pos */\nSELECT tblBufferPos.BufPos AS Parameter, tblBufferPos.Booked, tblBufferPos.ONo, tblBufferPos.OPos \nFROM tblBufferPos \nLEFT JOIN tblPNoGroup ON tblBufferPos.Zone = tblPNoGroup.Id \nWHERE (((tblBufferPos.BufPos)>0) AND \n	((tblBufferPos.PNo)=#Parameter3) AND \n	((tblBufferPos.ResourceId)=#ResourceID) AND \n	((tblBufferPos.BufNo)=1) AND \n	((tblPNoGroup.PNo)=#Parameter3) AND \n	((tblBufferPos.Zone)>0) AND \n	((tblBufferPos.Booked)=True)) \n	OR\n	(((tblBufferPos.BufPos)>0) AND \n	((tblBufferPos.PNo)=#Parameter3) AND \n	((tblBufferPos.ResourceId)=#ResourceID) AND \n	((tblBufferPos.BufNo)=1) AND \n	((tblBufferPos.Zone)=0) AND \n	((tblBufferPos.Booked)=True)) \n	OR \n	(((tblBufferPos.BufPos)>0) AND \n	((tblBufferPos.PNo)=#Parameter3) AND \n	((tblBufferPos.ResourceId)=#ResourceID) AND \n	((tblBufferPos.BufNo)=1) AND \n	((tblPNoGroup.PNo)=#Parameter3) AND \n	((tblBufferPos.Zone)>0) AND \n	((tblBufferPos.Booked)=False)) \n	OR\n	(((tblBufferPos.BufPos)>0) AND \n	((tblBufferPos.PNo)=#Parameter3) AND \n	((tblBufferPos.ResourceId)=#ResourceID) AND \n	((tblBufferPos.BufNo)=1) AND \n	((tblBufferPos.Zone)=0) AND \n	((tblBufferPos.Booked)=False)); \n\n/* update tblbufpos */\nUPDATE tblBufferPos \nSET tblBufferPos.Booked = True, tblBufferPos.ONo = #ONo, tblBufferPos.OPos = #OPos \nWHERE (((tblBufferPos.ResourceId)=#ResourceID) AND ((tblBufferPos.BufNo)=1) AND ((tblBufferPos.BufPos=#Parameter1)) AND #ResourceID = #RequestID );'),
	(210, 10, 2, '90', 1, ''),
	(210, 10, 3, '25', 2, 'SELECT tblParts.PNo AS ValueMember, CONCAT(tblParts.PNo , \' | \' , tblParts.Description) AS DisplayMember FROM tblParts INNER JOIN tblPNoGroup ON tblParts.PNo = tblPNoGroup.PNo WHERE tblPNoGroup.Id = 1 ORDER BY tblParts.PNo;'),
